import React from "react";
import imagen1 from '../assets/helados.jpg';
import imagen2 from '../assets/potes-helado.jpg';
import imagen3 from '../assets/helado-artesanal.jpg';

const Imagenes = () => {

    return (
        <div className="footer">
            <img src={imagen1}/>
            <img src={imagen2}/>
            <img src={imagen3}/>
        </div>
    );
}

export default Imagenes
